import './Ent.css';
import 'react-slideshow-image/dist/styles.css'
import pic3 from '../img/slide.PNG';
import { Col, Row, Container, Card, Button, Carousel} from "react-bootstrap";
import { LoremIpsum } from 'react-lorem-ipsum';
import { faLongArrowAltDown } from '@fortawesome/free-solid-svg-icons';


const slideImages = [
 pic3,pic3,pic3
];


function Ent() {
  return (
    <Container className="container" fluid>
        <p className="text7">‚ùù</p>
        <Carousel>
          <Carousel.Item interval={1000}>
            <img
              className="d-block w-100"
              src={pic3}
              alt="First slide"
            />
          </Carousel.Item>
          <Carousel.Item interval={500}>
            <img
              className="d-block w-100"
              src={pic3}
              alt="Second slide"
            />
          
          </Carousel.Item>
          <Carousel.Item>
            <img
              className="d-block w-100"
              src={pic3}
              alt="Third slide"
            />    
          </Carousel.Item>
        </Carousel>
        <Row>
          <h1>
            Entdecke jetzt deine <br/>nahrungsmittelunvertraglichkeiten!
          </h1>
          <h4>In nur 5 Minuten zu deinem individuellen Ergebnis</h4>
          <Col lg={4}sm={6}><Button className="button1"  variant="dark" > <h5>Fur Quick Check registriren</h5></Button></Col>
        </Row>
  </Container>    
          
  );
}

export default Ent;
